    __webpack_require__.r(__webpack_exports__);
    /* harmony default export */


    __webpack_exports__["default"] = "<ion-header>\n  <ion-toolbar>\n    <ion-buttons slot=\"start\">\n      <ion-menu-button></ion-menu-button>\n    </ion-buttons>\n    <ion-list lines=\"none\">\n      <ion-item>\n        <ion-avatar slot=\"start\">\n          <img src=\"../assets/logo.png\">\n        </ion-avatar>\n        <ion-label>About Us</ion-label>\n      </ion-item>\n    </ion-list>\n  </ion-toolbar>\n</ion-header>\n\n<ion-content class=\"ion-padding\">\n  <div style=\"text-align: justify;\">\n    <img src=\"../../assets/1Img.jpeg\" alt=\"\">\n    <h1>About AIPIF</h1>\n    <p>\n      Message of peace and love is the foundation of every human being on this earth, but\n      unfortunately today, instead of promoting the positive values of humanity certain evil\n      elements are engaged in developing rift and hatred among us. In this context it is the\n      responsibility of every peace-loving citizen of this country to introduce the positive teachings and to promote\n      mutual love, confidence and understanding between the\n      members of various communities and religions. <br> <br>\n      All India Payam-e-Insaniyat (The Message of Humanity) Forum is non-political, non-\n      religious, social organization. This organization is committed to promote the basic human\n      values among all citizens of India irrespective of cast, creed or religion purely on the\n      basis of humanity.\n    </p> <br>\n    <img src=\"../../assets/2Img.jpeg\" alt=\"\">\n    <h1>Aims &amp; Objectives</h1>\n    <ul>\n      <li>\n        To create mutual good-will and an atmosphere of affection\n        kindness purely on human and national levels founded on\n        BROTHERHOOD and WELL-BEING of MANKIND generally; to put\n        an end to violence, lawlessness, anarchy, moral degradation and\n        create FELLOW-FEELING towards each other.\n      </li>\n      <li>\n        <p>\n          To hold Public meetings and Seminars for promoting and spreading the sense of sharing sorrows and sufferings\n          of human beings.\n        </p>\n      </li>\n      <li>\n        <p>Publication of useful cultural/moral literature in various National,\n          Regional and widely spoken languages; to bring together through\n          service and sacriﬁce, people belonging to different classes and\n          communities; to restore conﬁdence amongst people who have\n          become sick of life; and restore/revive love for life in spiritually\n          sick souls and to give them a virtuous AIM of life.</p>\n      </li>\n      <li>\n        <p>To weed-out from the society and human race: Bribery and\n          illegal gratiﬁcation;Nepotism and favoritism;Misconceptions arising\n          out of hatred;Hoarding, proﬁteering and black-\n          marketing;Sectarianism;Disparity in economic and living standards\n          and Full-ﬂedged struggle against sub-standards behavioral\n          inclinations and obscenity.</p>\n      </li>\n      <li>\n        <p>To eradicate all ill-founded rites, rituals and cruel conventions.</p>\n      </li>\n      <li>\n        <p>To uplift the poor, the backward, the neglected, the down-\n          trodden, and the agonized people irrespective of caste, creed,\n          colour and gender.</p>\n      </li>\n      <li>\n        <p>\n          To create a sense of Sobriety, social service, submissiveness,\n          self-respect, self-restraint, self-conﬁdence, self-vigilance, and to\n          raise cultural and intellectual levels of the STUDENT COMMUNITY\n          and the up and coming GENERATION there by helping them to\n          grow into better and useful citizens.\n        </p>\n      </li>\n      <li>\n        <p>To extend all possible help in personal sphere and on the levels\n          of al locality, village and town and ﬁnally, in the Country</p>\n      </li>\n    </ul>\n    <br>\n    <img src=\"../../assets/3Img.jpeg\" alt=\"\">\n    <h1>AIPIF Medical Camps</h1>\n    <ul>\n      <li>\n        AIPIF - All India Payam-E-Insaniyat Forum, The message of\n        humanity, organizes various medical camps in poor villages and\n        localities and also provides free medicines.\n        This forum also helps the poor and needy people for treatment and\n        medicine and even surgery.\n      </li>\n      <li>\n        AIPIF has organized many free eye camps, asthma camp,\n        psychiatric camps, etc throughout the country, which is\n        undertaken by specialist Doctors.\n      </li>\n      <li>\n        We welcome humans those are having pain for humanity\n        irrespective of caste, colour or religion. Total no. of patients\n        attended in medical camps are approximately 120000 (more than a\n        lakh patients so far). This is also a very conservative figure.\n      </li>\n    </ul>\n    <br>\n    <img src=\"../../assets/4Img.jpeg\" alt=\"\">\n    <br>\n    <p>More about AIPIF <a target=\"#\" href=\"http://aipiftsap.org/\">here</a></p>\n  </div>\n</ion-content>\n<ion-footer class=\"ion-no-border ion-justify-content-center\"\n  style=\"background-color: #fe616a !important; color: #ffff !important;\">\n  <p style=\"text-align: center; background-color: #fe616a; color: #ffff;\">All India Payam-E-Insaniyat\n    Forum.<br>&copy;&nbsp;All Rights Reserved.</p>\n</ion-footer>";
